  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of in situ
  daily meteorological observations for Kazakhstan within the framework of joint efforts
  to create Global Daily Climatology Network (GDCN) among the Kazakhstani Scientific
  Research Institute of Ecology and Climate of the Ministry of Environment Protection
  of the Republic of Kazakhstan, All-Russian Research Institute for Hydrometeorological
  Information-World Data Center of the Federal Service for Hydrometeorology and Environmental
  Monitoring, Obninsk, Russian Federation, and NOAA National Climatic Data Center,
  Asheville, North Carolina. Transmitted information was verified versus the original
  data holdings at the national hydrometeorological archives of the former USSR (prior
  to 1991) and The Republic of Kazakhstan, and appended when it was necessary. The
  number of stations varied over the period of record. Variables in the dataset include
  sea level and station pressure, surface air temperature, relative humidity, wind
  speed, and observed precipitation.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
